re her data with project collaborators via the networked NAS drive that is accessible for all project participants.  Sue will oversee all data QA/QC.  Jane and Sara will prepare the DMP using the Portage DMP Assistant online; Sue will approve the DMP.  At the project completion, Jane will then work with project Data Manager, Sara Jenkins, to prepare the data and metadata for sharing.  Sara will upload the metadata and data to identified repositories.","created_at":"2020-03-26 13:34:39 UTC","updated_at":"2020-03-26 14:20:23 UTC","is_example":1},{"id":469,"question_id":670,"organisation_id":16,"text":"","created_at":"2020-03-26 13:38:59 UTC","updated_at":"2020-03-26 13:38:59 UTC","is_example":1},{"id":470,"question_id":671,"organisation_id":16,"text":"Researcher Jane is the primary author on products from this research; Jane will include co-authors Professor Sue and Professor Paul; other authors may be added during project lifespan.  If Jane does not finish her PhD, Professor Sue will assume responsibility for Jane’s data and primary authorship on future research products","created_at":"2020-03-26 13:40:06 UTC","updated_at":"2020-03-26 14:24:06 UTC","is_example":1},{"id":471,"question_id":672,"organisation_id":16,"text":"An example naming convention might include: Proj [3-4 letters]_Sub-Proj [4 letters]_Location_Theme [e.g., chemistry]_Sub-Theme or Analysis_Date [YYYYMMDD]_data state, e.g., OFI_ModE_NAIN_chem_CTD_20190430_RAW.csv to indicate a file containing raw CTD data collected on April 30, 2019 in Nain, NL as part of the OFI Module E project.","created_at":"2020-03-26 13:42:28 UTC","updated_at":"2020-03-26 14:24:57 UTC","is_example":1},{"id":472,"question_id":673,"organisation_id":16,"text":"Ecological Markup Language (EML) standard; Darwin Core; ISO 19115 ","created_at":"2020-03-26 13:43:16 UTC","updated_at":"2020-03-26 15:19:39 UTC","is_example":1},{"id":473,"question_id":674,"organisation_id":16,"text":"“Stimulus identifiers are saved in MATLAB’s “.mat” format. To understand the dataset, the following information is needed: Animal description (age, gender, rearing condition), recording description (location, type and impedance of electrodes, sampling rates), stimulus description (stimulus class, explanation of stimulus IDs), experimental history, analysis parameters (settings for spike sorting, isolation quality for every single unit).  Metadata will be provided as a text document with every file. We follow a standard convention for naming data files that indicates the animal, recording type, and experiment.  Text documents will follow the same standard to link them to their corresponding data set. Standards for describing this kind of data are under development by the community.”  (source: Johns Hopkins Data Management Services. (2017) “Data Management Planning Questionnaire” Johns Hopkins University Sheridan Libraries. Revised 02/10/2017. http://dms.data.jhu.edu/assistance/guidance-on-writing-data-management-plans)\r\n","created_at":"2020-03-26 13:57:18 UTC","updated_at":"2020-03-26 14:26:51 UTC","is_example":1},{"id":474,"question_id":675,"organisation_id":16,"text":"geochemical datasets and model outputs will comprise approximately 3GB and will be stored by the primary researcher for a minimum of 5 years after project completion, in accordance with Memorial University’s data management policy","created_at":"2020-03-26 14:28:01 UTC","updated_at":"2020-03-26 14:28:01 UTC","is_example":1},{"id":475,"question_id":676,"organisation_id":16,"text":"During the project, data will be stored on the primary researcher’s laptop, secondarily on an external, storage device, and also backed up to department-managed networked storage (this also has a daily networked backup) provided by the Module PI.  Local storage on laptops and external hard drives is encrypted, according to Memorial University policy.  Access to networked storage is managed by the department using a personal log-in and password.","created_at":"2020-03-26 14:28:51 UTC","updated_at":"2020-03-26 14:28:51 UTC","is_example":1},{"id":476,"question_id":677,"organisation_id":16,"text":"The research group share data through direct transfer via email and data storage devices.  PIs and researchers located on Memorial University’s campus can access files stored on the networked storage.  For collaborative data editing and sharing, the project has established a Google Drive folder.  Within this Drive folder, a systematic subfolder system has been established to help guide project collaborators to data and files that are available for internal sharing, in addition to indicating which files are considered authoritative vs in-progress.","created_at":"2020-03-26 14:29:48 UTC","updated_at":"2020-03-26 14:29:48 UTC","is_example":1},{"id":477,"question_id":678,"organisation_id":16,"text":"The data will not need to be archived by the PIs at the University beyond the 5-year period mentioned previously.  ","created_at":"2020-03-26 14:30:27 UTC","updated_at":"2020-03-26 14:30:27 UTC","is_example":1},{"id":478,"question_id":679,"organisation_id":16,"text":"","created_at":"2020-03-26 14:33:13 UTC","updated_at":"2020-03-26 14:33:13 UTC","is_example":1},{"id":479,"question_id":680,"organisation_id":16,"text":"","created_at":"2020-03-26 14:35:50 UTC","updated_at":"2020-03-26 14:35:50 UTC","is_example":1},{"id":480,"question_id":681,"organisation_id":16,"text":"","created_at":"2020-03-26 14:50:51 UTC","updated_at":"2020-03-26 14:50:51 UTC","is_example":1},{"id":481,"question_id":682,"organisation_id":16,"text":"","created_at":"2020-03-26 14:51:32 UTC","updated_at":"2020-03-26 14:51:32 UTC","is_example":1},{"id":482,"question_id":683,"organisation_id":16,"text":"","created_at":"2020-03-26 14:59:50 UTC","updated_at":"2020-03-26 14:59:50 UTC","is_example":1},{"id":483,"question_id":684,"organisation_id":16,"text":"","created_at":"2020-03-26 15:00:29 UTC","updated_at":"2020-03-26 15:00:29 UTC","is_example":1},{"id":484,"question_id":685,"organisation_id":16,