02/10/2017. http://dms.data.jhu.edu/assistance/guidance-on-writing-data-management-plans)","created_at":"2020-04-07 22:25:57 UTC","updated_at":"2020-04-07 22:25:57 UTC","is_example":1},{"id":526,"question_id":727,"organisation_id":15,"text":"geochemical datasets and model outputs will comprise approximately 3GB and will be stored by the primary researcher for a minimum of 5 years after project completion. Dalhousie University does not have a policy of data retention, however, it is common to retain data for at least five years: https://www.dal.ca/dept/research-services/responsible-conduct-/research-ethics-/faqs.html. ","created_at":"2020-04-07 22:26:59 UTC","updated_at":"2020-04-09 18:32:46 UTC","is_example":1},{"id":527,"question_id":728,"organisation_id":15,"text":"During the project, data will be stored on the primary researcher’s laptop, secondarily on an external, storage device, and also backed up to department-managed networked storage (this also has a daily networked backup) provided by the Module PI. Local storage on laptops and external hard drives is encrypted. Access to networked storage is managed by the department using a personal log-in and password.","created_at":"2020-04-07 22:28:57 UTC","updated_at":"2020-04-07 22:28:57 UTC","is_example":1},{"id":528,"question_id":729,"organisation_id":15,"text":"The research group share data through direct transfer via data storage devices. PIs and researchers located on Dalhousie University’s campus can access files stored on the networked storage. For collaborative data editing and sharing, the project has established a SharePoint folder. Within this folder, a systematic subfolder system has been established to help guide project collaborators to data and files that are available for internal sharing, in addition to indicating which files are considered authoritative vs in-progress.","created_at":"2020-04-07 22:31:08 UTC","updated_at":"2020-04-07 22:31:08 UTC","is_example":1},{"id":529,"question_id":730,"organis